import React, {useState} from 'react';
import GetMyCabins from './GetMyCabins';
import {getAdmin} from "../../../Utils/Common";


export default function MyCabins(props){

    const [user_id, setUser_id] = useState(0);

    if (typeof props.location.state.user_id !== 'undefined') {
        setUser_id(props.location.state.user_id);
    }

    if (getAdmin() == false)
    {
    return(
        <div>
            <h3>My Cabins</h3>
            <GetMyCabins id={sessionStorage.getItem("user_id")}/>
        </div>
    )
    }

    else
    {
    return(
        <div>
            <h3>Cabins</h3>
            <GetMyCabins id={user_id}/>
        </div>
    )
    }
}
